import React, {useState} from 'react'

function UseEffectCounterCount() {
  const [display, setDisplay] = useState(true);
  return (
    <div>
      <button onClick={() => {
      setDisplay(!display)
      }}>
        Toggle Display
      </button>
      {display && <UseEffectCounterCount />}
    </div>
  )
}

export default UseEffectCounterCount
